import React, { Component } from 'react'
import sample from "./Dandelion2.mp4"
import logo from "./logo.png"
import { Transition, animated } from 'react-spring/renderprops'
import './styles.css'


export default class Launch extends Component {
    state = { show: true }
  toggle = e => this.setState(state => ({ show: !state.show }))
    render() {
        return (
            <div>
                <video id="background-video" className='videoTag' autoPlay loop muted>
                    <source src={sample} type='video/mp4' />
                </video>
                <div className="viewport-header">

                    <img className="btn reveals-main" src={logo} onClick={this.toggle}></img>
                    <Transition
          native
          items={this.state.show}
          from={{ position: 'absolute', overflow: 'hidden', height: 0 }}
          enter={[{ height: 'auto' }]}
          leave={{ height: 0 }}>
          {show =>
            show && (props => <animated.div style={props}>hello</animated.div>)
          }
        </Transition>

                </div>
            </div>
        )
    }
}
